import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Header from './components/Header';
import IrisPredictForm from './components/IrisPredictForm';
import ResultPredictForm from './components/Cifar10PredictForm';
import Home from './components/Home';
import Register from './pages/Register';
import Login from './pages/Login';
import { UserProvider, useUser } from './contexts/UserContext';

const App = () => {
  return (
    <UserProvider>
      <Router>
        <Header />
        <Routes>
          <Route path="/" element={<ProtectedRoute component={Home} />} />
          <Route path="/iris-model" element={<ProtectedRoute component={IrisPredictForm} />} />
          <Route path="/result-model" element={<ProtectedRoute component={ResultPredictForm} />} />
          <Route path="/register" element={<PublicRoute component={Register} />} />
          <Route path="/login" element={<PublicRoute component={Login} />} />
        </Routes>
      </Router>
    </UserProvider>
  );
};

const ProtectedRoute = ({ component: Component }) => {
  const { user } = useUser();
  return user ? <Component /> : <Navigate to="/login" />;
};

const PublicRoute = ({ component: Component }) => {
  const { user } = useUser();
  return user ? <Navigate to="/" /> : <Component />;
};

export default App;
